import './Skills.css';

interface ISkills {
    "id": number;
    "skill": string;
}


export const Skills = ({skills}: ISkills) => {
  return (
    <div className='skillsBox'>
        <h4>Skills</h4>
        <ul>
            {skills.map()}
            <li>Java</li>
            <li>Python</li>
        </ul>
    </div>
  )
}
